-- ----------------------------
-- Table structure for t_sys_invite
-- ----------------------------
DROP TABLE IF EXISTS `t_sys_invite`;
CREATE TABLE `t_sys_invite`  (
  `urid` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `projectid` int(11) NOT NULL COMMENT '项目编号',
  `opentime` date NULL DEFAULT NULL COMMENT '开标时间',
  `openposition` varchar(255) CHARACTER SET utf8 COLLATE utf8_bin NULL DEFAULT NULL COMMENT '开标地点',
  `hit` varchar(255) CHARACTER SET utf8 COLLATE utf8_bin NULL DEFAULT NULL COMMENT '中标单位',
  `hitscore` varchar(255) CHARACTER SET utf8 COLLATE utf8_bin NULL DEFAULT NULL COMMENT '中标评分',
  `hittime` date NULL DEFAULT NULL COMMENT '中标时间',
  `createdby` varchar(255) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL COMMENT '创建人',
  `createdon` datetime(0) NOT NULL COMMENT '创建时间',
  `updatedby` varchar(255) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL COMMENT '更新时间',
  `updatedon` datetime(0) NOT NULL COMMENT '更新时间',
  `reversion` int(11) NOT NULL DEFAULT 1 COMMENT '版本号',
  `supplierid` int(11) NULL DEFAULT NULL COMMENT '接收人',
  PRIMARY KEY (`urid`) USING BTREE,
  INDEX `FK_INVITE_PROJECTID`(`projectid`) USING BTREE,
  INDEX `FK_INVITE_SUPPLIERID`(`supplierid`) USING BTREE,
  CONSTRAINT `FK_INVITE_PROJECTID` FOREIGN KEY (`projectid`) REFERENCES `t_sys_project` (`urid`) ON DELETE RESTRICT ON UPDATE RESTRICT,
  CONSTRAINT `FK_INVITE_SUPPLIERID` FOREIGN KEY (`supplierid`) REFERENCES `t_sys_supplier` (`urid`) ON DELETE RESTRICT ON UPDATE RESTRICT
) ENGINE = InnoDB CHARACTER SET = utf8 COLLATE = utf8_bin COMMENT = '邀标书' ROW_FORMAT = Dynamic;

