-- ----------------------------
-- Table structure for t_sys_message
-- ----------------------------
DROP TABLE IF EXISTS `t_sys_message`;
CREATE TABLE `t_sys_message`  (
  `urid` int(11) NOT NULL COMMENT '主键',
  `tenderingid` int(11) NULL DEFAULT NULL COMMENT '招标商的id',
  `supplierid` int(11) NULL DEFAULT NULL COMMENT '投标商的id',
  `projectid` int(11) NULL DEFAULT NULL COMMENT '项目id',
  `sendtime` datetime(0) NULL DEFAULT NULL COMMENT '发送消息时间',
  `lastmessageid` int(11) NULL DEFAULT NULL COMMENT '上一条消息的id',
  `content` varchar(4000) CHARACTER SET utf8 COLLATE utf8_bin NULL DEFAULT NULL COMMENT '发送的内容',
  `createdby` varchar(255) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL COMMENT '创建人',
  `createdon` datetime(0) NOT NULL COMMENT '创建时间',
  `updatedby` varchar(255) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL COMMENT '更新时间',
  `updatedon` datetime(0) NOT NULL COMMENT '更新时间',
  `reversion` int(11) NOT NULL DEFAULT 1 COMMENT '版本号',
  PRIMARY KEY (`urid`) USING BTREE,
  INDEX `FK_MESSAGE_SUPPLIERID`(`supplierid`) USING BTREE,
  INDEX `FK_MESSAGE_TENDERINGID`(`tenderingid`) USING BTREE,
  INDEX `FK_MESSAGE_PROJECTID`(`projectid`) USING BTREE,
  CONSTRAINT `FK_MESSAGE_PROJECTID` FOREIGN KEY (`projectid`) REFERENCES `t_sys_project` (`urid`) ON DELETE RESTRICT ON UPDATE RESTRICT,
  CONSTRAINT `FK_MESSAGE_SUPPLIERID` FOREIGN KEY (`supplierid`) REFERENCES `t_sys_supplier` (`urid`) ON DELETE RESTRICT ON UPDATE RESTRICT,
  CONSTRAINT `FK_MESSAGE_TENDERINGID` FOREIGN KEY (`tenderingid`) REFERENCES `t_sys_user` (`urid`) ON DELETE RESTRICT ON UPDATE RESTRICT
) ENGINE = InnoDB CHARACTER SET = utf8 COLLATE = utf8_bin COMMENT = '问题澄清表' ROW_FORMAT = Dynamic;

-- ----------------------------
-- Table structure for t_sys_mytask
-- ----------------------------
DROP TABLE IF EXISTS `t_sys_mytask`;
CREATE TABLE `t_sys_mytask`  (
  `urid` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `taskid` varchar(255) CHARACTER SET utf8 COLLATE utf8_bin NULL DEFAULT NULL COMMENT '任务id',
  `assignee` varchar(255) CHARACTER SET utf8 COLLATE utf8_bin NULL DEFAULT NULL COMMENT '任务办理人',
  `processInstenceid` varchar(255) CHARACTER SET utf8 COLLATE utf8_bin NULL DEFAULT NULL COMMENT '流程实例id',
  `tasktype` varchar(255) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL COMMENT '任务类型',
  `suggest` varchar(255) CHARACTER SET utf8 COLLATE utf8_bin NULL DEFAULT NULL COMMENT '审批意见',
  `complete` char(255) CHARACTER SET utf8 COLLATE utf8_bin NULL DEFAULT NULL COMMENT '是否已完成',
  `createdby` varchar(255) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL COMMENT '创建人',
  `createdon` datetime(0) NOT NULL COMMENT '创建时间',
  `updatedby` varchar(255) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL COMMENT '更新人',
  `updatedon` datetime(0) NOT NULL COMMENT '更新时间',
  `reversion` int(11) NOT NULL DEFAULT 1 COMMENT '版本号',
  PRIMARY KEY (`urid`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8 COLLATE = utf8_bin ROW_FORMAT = Dynamic;

-- ----------------------------
-- Table structure for t_sys_notice
-- ----------------------------
DROP TABLE IF EXISTS `t_sys_notice`;
CREATE TABLE `t_sys_notice`  (
  `urid` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `code` varchar(255) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL COMMENT '招标编号',
  `tendingid` varchar(32) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL COMMENT '招标商id\r\n',
  `position` varchar(255) CHARACTER SET utf8 COLLATE utf8_bin NULL DEFAULT NULL COMMENT '招标地点',
  `time` date NOT NULL COMMENT '投标时间',
  `projectid` int(11) NOT NULL COMMENT '项目编号',
  `startdate` date NOT NULL COMMENT '开始时间',
  `enddate` date NOT NULL COMMENT '结束时间',
  `createdby` varchar(255) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL COMMENT '创建人',
  `createdon` datetime(0) NOT NULL COMMENT '创建时间',
  `updatedby` varchar(255) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL COMMENT '更新时间',
  `updatedon` datetime(0) NOT NULL COMMENT '更新时间',
  `reversion` int(11) NOT NULL DEFAULT 1 COMMENT '版本号',
  `approvestate` char(1) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL COMMENT '审批状态',
  `cancelstate` char(1) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL COMMENT '作废状态',
  `content` varchar(4000) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL COMMENT '内容',
  `name` varchar(255) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL COMMENT '公告标题',
  `processinstanceid` varchar(255) CHARACTER SET utf8 COLLATE utf8_bin NULL DEFAULT NULL COMMENT '流程实例id',
  PRIMARY KEY (`urid`) USING BTREE,
  UNIQUE INDEX `name`(`name`) USING BTREE,
  INDEX `FK_NOTICE_PROJECTID`(`projectid`) USING BTREE,
  CONSTRAINT `FK_NOTICE_PROJECTID` FOREIGN KEY (`projectid`) REFERENCES `t_sys_project` (`urid`) ON DELETE RESTRICT ON UPDATE RESTRICT
) ENGINE = InnoDB AUTO_INCREMENT = 25 CHARACTER SET = utf8 COLLATE = utf8_bin COMMENT = '招标公告信息' ROW_FORMAT = Dynamic;

