-- ----------------------------
-- Table structure for t_sys_sumup
-- ----------------------------
DROP TABLE IF EXISTS `t_sys_sumup`;
CREATE TABLE `t_sys_sumup`  (
  `urid` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `code` varchar(255) CHARACTER SET utf8 COLLATE utf8_bin NULL DEFAULT NULL COMMENT '招标编号',
  `projectid` int(11) NULL DEFAULT NULL COMMENT '项目编号',
  `description` varchar(1024) CHARACTER SET utf8 COLLATE utf8_bin NULL DEFAULT NULL COMMENT '招标情况',
  `hitdescription` varchar(1024) CHARACTER SET utf8 COLLATE utf8_bin NULL DEFAULT NULL COMMENT '定标情况',
  `result` varchar(255) CHARACTER SET utf8 COLLATE utf8_bin NULL DEFAULT NULL COMMENT '中标情况',
  `opdate` datetime(0) NULL DEFAULT NULL COMMENT '编写时间',
  `userid` int(11) NULL DEFAULT NULL COMMENT '编写人',
  `createdby` varchar(255) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL COMMENT '创建人',
  `createdon` datetime(0) NOT NULL COMMENT '创建时间',
  `updatedby` varchar(255) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL COMMENT '更新时间',
  `updatedon` datetime(0) NOT NULL COMMENT '更新时间',
  `reversion` int(11) NOT NULL DEFAULT 1 COMMENT '版本号',
  PRIMARY KEY (`urid`) USING BTREE,
  INDEX `FK_SUMUP_PROJECTID`(`projectid`) USING BTREE,
  INDEX `FK_SUMUP_USERID`(`userid`) USING BTREE,
  CONSTRAINT `FK_SUMUP_PROJECTID` FOREIGN KEY (`projectid`) REFERENCES `t_sys_project` (`urid`) ON DELETE RESTRICT ON UPDATE RESTRICT,
  CONSTRAINT `FK_SUMUP_USERID` FOREIGN KEY (`userid`) REFERENCES `t_sys_user` (`urid`) ON DELETE RESTRICT ON UPDATE RESTRICT
) ENGINE = InnoDB CHARACTER SET = utf8 COLLATE = utf8_bin COMMENT = '招标总结书' ROW_FORMAT = Dynamic;

-- ----------------------------
-- Table structure for t_sys_supplier
-- ----------------------------
DROP TABLE IF EXISTS `t_sys_supplier`;
CREATE TABLE `t_sys_supplier`  (
  `urid` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `userid` varchar(32) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL COMMENT '用户账号',
  `password` varchar(255) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL COMMENT '密码',
  `salt` varchar(255) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL COMMENT '加盐',
  `score` int(11) NULL DEFAULT NULL COMMENT '信誉分',
  `bidcount` int(255) NULL DEFAULT NULL COMMENT '中标次数',
  `taxid` varchar(64) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL COMMENT '统一社会信用代码',
  `email` varchar(255) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL COMMENT '邮箱',
  `invitedcount` int(11) NULL DEFAULT NULL COMMENT '被邀请次数',
  `name` varchar(255) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL COMMENT '供应商名称',
  `approvestate` char(1) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL COMMENT '审批状态 1-未审批 2-审批中 3-已审批，4-已拒绝',
  `cancelstate` char(1) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL COMMENT '作废状态 1-未作废 2-作废中 3-已作废',
  `address` varchar(255) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL COMMENT '供应商地址',
  `telephone` varchar(255) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL COMMENT '联系方式',
  `typeid` int(11) NULL DEFAULT NULL COMMENT '供应商类型',
  `createdby` varchar(255) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL COMMENT '创建人',
  `createdon` datetime(0) NOT NULL COMMENT '创建时间',
  `updatedby` varchar(255) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL COMMENT '更新人',
  `updatedon` datetime(0) NOT NULL COMMENT '更新时间',
  `reversion` int(11) NOT NULL DEFAULT 1 COMMENT '版本号',
  `processinstanceid` varchar(255) CHARACTER SET utf8 COLLATE utf8_bin NULL DEFAULT NULL COMMENT '流程实例id',
  PRIMARY KEY (`urid`) USING BTREE,
  INDEX `FK_SUPPLIER_TYPEID`(`typeid`) USING BTREE,
  CONSTRAINT `FK_SUPPLIER_TYPEID` FOREIGN KEY (`typeid`) REFERENCES `t_sys_suppliertype` (`urid`) ON DELETE RESTRICT ON UPDATE RESTRICT
) ENGINE = InnoDB AUTO_INCREMENT = 52 CHARACTER SET = utf8 COLLATE = utf8_bin COMMENT = '供应商信息表' ROW_FORMAT = Dynamic;

