-- ----------------------------
-- Table structure for t_sys_supplierlist
-- ----------------------------
DROP TABLE IF EXISTS `t_sys_supplierlist`;
CREATE TABLE `t_sys_supplierlist`  (
  `urid` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `code` varchar(255) CHARACTER SET utf8 COLLATE utf8_bin NULL DEFAULT NULL COMMENT '招标编号',
  `projectid` int(11) NULL DEFAULT NULL COMMENT '项目编号',
  `supplierid` int(11) NULL DEFAULT NULL COMMENT '供应商id',
  `createdby` varchar(255) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL COMMENT '创建人',
  `createdon` datetime(0) NOT NULL COMMENT '创建时间',
  `updatedby` varchar(255) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL COMMENT '更新人',
  `updatedon` datetime(0) NOT NULL COMMENT '更新时间',
  `reversion` int(11) NOT NULL DEFAULT 1 COMMENT '版本号',
  `approvestate` char(1) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL COMMENT '审核状态',
  `tenderid` varchar(32) CHARACTER SET utf8 COLLATE utf8_bin NULL DEFAULT NULL COMMENT '招标商id',
  PRIMARY KEY (`urid`) USING BTREE,
  INDEX `FK_SUPPLIERLIST_PROID`(`projectid`) USING BTREE,
  INDEX `FK_SUPPLIERLIST_SUPID`(`supplierid`) USING BTREE,
  CONSTRAINT `FK_SUPPLIERLIST_PROJECTID` FOREIGN KEY (`projectid`) REFERENCES `t_sys_project` (`urid`) ON DELETE RESTRICT ON UPDATE RESTRICT
) ENGINE = InnoDB AUTO_INCREMENT = 13 CHARACTER SET = utf8 COLLATE = utf8_bin COMMENT = '符合招投标信息的供应商表' ROW_FORMAT = Dynamic;

