  `urid` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `code` varchar(32) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL COMMENT '用户账号',
  `lastlogintime` datetime(0) NULL DEFAULT NULL COMMENT '上次登录时间',
