DROP TABLE IF EXISTS `t_sys_userfile`;
CREATE TABLE `t_sys_userfile`  (
  `urid` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `code` varchar(255) CHARACTER SET utf8 COLLATE utf8_bin NULL DEFAULT NULL COMMENT '文件编号',
  `type` char(1) CHARACTER SET utf8 COLLATE utf8_bin NULL DEFAULT NULL COMMENT '文件类型',
  `name` varchar(255) CHARACTER SET utf8 COLLATE utf8_bin NULL DEFAULT NULL COMMENT '文件名称',
  `userid` int(11) NULL DEFAULT NULL COMMENT '上传人',
  `uploadtime` datetime(0) NULL DEFAULT NULL COMMENT '上传时间',
  `projectid` int(11) NULL DEFAULT NULL COMMENT '项目编号',
  `download` int(11) NULL DEFAULT 0 COMMENT '下载次数',
  `url` varchar(255) CHARACTER SET utf8 COLLATE utf8_bin NULL DEFAULT NULL COMMENT '存储路劲',
  `createdby` varchar(255) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL COMMENT '创建人',
  `createdon` datetime(0) NOT NULL COMMENT '创建时间',
  `updatedby` varchar(255) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL COMMENT '更新时间',
  `updatedon` datetime(0) NOT NULL COMMENT '更新时间',
  `reversion` int(11) NOT NULL DEFAULT 1 COMMENT '版本号',
  `amount` varchar(255) CHARACTER SET utf8 COLLATE utf8_bin NULL DEFAULT NULL COMMENT '金额',
  `content` varchar(4000) CHARACTER SET utf8 COLLATE utf8_bin NULL DEFAULT NULL COMMENT '内容',
  `uploadname` varchar(255) CHARACTER SET utf8 COLLATE utf8_bin NULL DEFAULT NULL COMMENT '附件名称',
  PRIMARY KEY (`urid`) USING BTREE,
  INDEX `FK_INVITEBOOK_COMPANYID`(`name`) USING BTREE,
  INDEX `FK_INVITEBOOK_PROJECTID`(`projectid`) USING BTREE,
  INDEX `FK_FILE_USERID`(`userid`) USING BTREE,
  CONSTRAINT `FK_FILE_PROJECTID` FOREIGN KEY (`projectid`) REFERENCES `t_sys_project` (`urid`) ON DELETE RESTRICT ON UPDATE RESTRICT,
  CONSTRAINT `FK_FILE_USERID` FOREIGN KEY (`userid`) REFERENCES `t_sys_user` (`urid`) ON DELETE RESTRICT ON UPDATE RESTRICT
) ENGINE = InnoDB AUTO_INCREMENT = 20 CHARACTER SET = utf8 COLLATE = utf8_bin COMMENT = '招标书' ROW_FORMAT = Dynamic;

